import { Fragment } from "react";
import Header from "./components/Layout/Header";
import Chickens from "./components/Chickens/Chickens";
import Cart from "./components/Cart/Cart";
function App() {
  return (
    <Fragment>
      <Cart />
      <Header/>
      <main>
        <Chickens/>
      </main>
    </Fragment>
  );
}

export default App;
